import { Route, Routes } from 'react-router-dom';
import './App.css';

function App() {
  return (
    <div >
      <Navigation/>
      <Routes>
        <Route path='/' element={<HomeUi/>}/>
        <Route path='/teams' element={<Teams/>}/>
        <Route path='/about' element={<AboutUi/>}/>
        <Route path='/table' element={<TableUi/>}/>
        <Route path='/addPlayer' element={<AddUi/>}/>

        </Routes>
    </div>
  );
}

export default App;
